import React from 'react';
import CartItem from './CartItem'
import Card from '../UI/Card'
import classes from './Cart.module.css'
const Cart = (props) => {
  return (
    <Card className={classes.cart}>
    
      {props.items.map( (item)=> <CartItem
        key={item.id}
        name={item.name}
        description={item.description}
        price={item.price} />)}
    </Card>
  )
}

export default Cart;
